import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class Dopa extends Component {
        constructor(props) {
          super(props);
          this.state = { 
            Solute: 400,
            Solvent: 250,
            Rate_ml : 10,
            Rate_kg : 15,
         };
        }

    handleIncFENa = () => {
            this.setState(state => ({ 
                FENa: ((this.state.UNaValue/this.state.SNaValue)/(this.state.UCreValue/this.state.SCreValue)).toFixed(4)
            }))
        };

    handleChangeSNa = (e) => this.setState({SNaValue: e.target.value});
    handleChangeUNa = (e) => this.setState({UNaValue: e.target.value});
    handleChangeSCre = (e) => this.setState({SCreValue: e.target.value});
    handleChangeUCre = (e) => this.setState({UCreValue: e.target.value});

    render() {
        return (
            <div>
                <h2>Dopamine infusion rate</h2>
                <label>Dopamine<input type="number" value={this.state.SNaValue} onChange={this.handleChangeSNa}/>mg<a>&nbsp;</a></label>
                <label>N/S<input type="number" value={this.state.UNaValue} onChange={this.handleChangeUNa}/>ml<a>&nbsp;</a></label>
                <br></br>
                <label>Run<input type="number" value={this.state.SCreValue} onChange={this.handleChangeSCre}/>ml/hr<a>&nbsp;</a></label>
                <br></br>
                <label>Equal<input type="number" value={this.state.UCreValue} onChange={this.handleChangeUCre}/>mcg/kg/min<a>&nbsp;</a></label>
                <span>
                    <button onClick={this.handleIncFENa}>calculate</button>
                </span>
                <h3>FENa: {100*(this.state.FENa)}%</h3>
            </div>
        );
    }
}
